import Header from '../../components/header/header';
import Footer from '../../components/footer/footer';

function App() {
  return (
    <div>
      <Header></Header>

      <main>
        <section>
          <p>Simulação pronta</p>
          <h1>Escolha a opção de sua preferência para solicitar aprovação de crédito.</h1>
        </section>
      </main>

      <Footer></Footer>
    </div>
  );
}

export default App;
